import React, { Component } from 'react';
import './App.css';

import * as s2p from 'shape2path';
import * as mjs from 'makerjs';

let t = s2p.rect({x: 0, y: 120, width: 200, height: 200, rx: 20, ry: 10});

console.log(t);

let m = mjs.importer.fromSVGPathData(t);

console.log(m);

let svg = mjs.exporter.toSVG(m);
console.log(svg)



class App extends Component {
  render() {
    return (
      <div>
        Hello World
        {svg}
      </div>
    );
  }
}

export default App;
